import React from "react";
import { Link } from 'react-router-dom';


function ArtistsCard(props) {
    return (
        <div class="card  text-black">
            <img class="card-img-top fixed-height-img" src="StaticImages/aboutPageAustin.jpg" alt="artistsPic" />

            <div class ="card-body text-start d-flex flex-column">
                <h1>Austin</h1>
                <span>#20</span>
                <span>Country</span>
                <span>Latest Album : Astroworld</span>
            </div>
            <div class ="card-body text-start d-flex flex-column">
                <h1>Venues</h1>
                <span>#20</span>
                <span>Country</span>
                <span>Latest Album : Astroworld</span>
            </div>


        </div>


    );

}

export default ArtistsCard;



